import React, { useState } from 'react';

function FormViagem({ addViagem }) {
    const [origem, setOrigem] = useState('');
    const [destino, setDestino] = useState('');
    const [duracao, setDuracao] = useState('');
    const [deadline, setDeadline] = useState('');

    const handleAddViagem = (event) => {
        event.preventDefault();
        addViagem(origem, destino, duracao, deadline);
        setOrigem('');
        setDestino('');
        setDuracao('');
        setDeadline('');
    }

    return (
        <form onSubmit={handleAddViagem}>
            <label>
                Origem:
                <input type="text" value={origem} onChange={e => setOrigem(e.target.value)} />
            </label>
            <label>
                Destino:
                <input type="text" value={destino} onChange={e => setDestino(e.target.value)} />
            </label>
            <label>
                Duração:
                <input type="text" value={duracao} onChange={e => setDuracao(e.target.value)} />
            </label>
            <label>
                Deadline:
                <input type="date" value={deadline} onChange={e => setDeadline(e.target.value)} />
            </label>
            <input type="submit" value="Adicionar Viagem" />
        </form>
    );
}

export default FormViagem;
